from EMDAT.src.data_structures import Datapoint, Fixation
from EMDAT.src.Segment import Segment
from EMDAT.src.Recording import read_aoilines
from itertools import izip

def generate_features(segment_id, raw_gaze_points, raw_fixations, raw_aois):
    """
    Generates machine learning features from gaze points, raw_fixations and AOIs.
    
    @type segment_id: string
    @param segment_id: id for the segment
    
    @type raw_gaze_points: string
    @param raw_gaze_points: string formatted like lines from a Tobii all data export
    
    @type raw_fixations: string
    @param raw_fixations: string formatted like lines from a Tobii fixation export
    
    @type raw_aois: string
    @param raw_aois: AOI definitions
    
    @return dictionary of feature value pairs. Features and values are in string format.
    """

    # init
    gaze_points = [] if len(raw_gaze_points) == 0 else map(Datapoint, raw_gaze_points)
    fixations = [] if len(raw_fixations) == 0 else map(Fixation, raw_fixations.split('\n'))
    aois = [] if len(raw_aois) == 0 else read_aoilines(raw_aois)
    
    # generate features
    return parse_as_segment(segment_id, gaze_points, fixations, aois)


def parse_as_segment(segment_id, gaze_points, fixations, aois):
    """separated for testing purposes"""

    segment = Segment(segment_id, gaze_points, fixations, aois)
    feature_names, feature_values = segment.get_features()
    features = dict(izip(feature_names, feature_values))
    return features


